import React from "react";
import "./collection-preview.styles.scss";

const CollectionsPreview = ({ title = "", items = [] }) => (
  <div>
    <h1>{title}</h1>
    <div>
      {items.map((item) => (
        <div key={item.id}> {item.title}</div>
      ))}
    </div>
  </div>
);

export default CollectionsPreview;
